import React, { Component } from 'react'
import Home from './Home'
import Login from './Login'

export default class Conditional_Rendering extends Component {
    constructor(props){
        super(props)

        this.state = {
            isLogIn: false
        }
    }
  render() {

    if(this.state.isLogIn){
       return(
        <Home />
       )
    }else{
        <Login />
    }

  }
}
